import React from 'react';
import Recipe from "./Recipe"
import './App.css';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <section id = "Header">
            <Recipe></Recipe>
        </section>
      </header>
    </div>
  );
}
export default App;
